import React from "react";
import '/headerMain.css';
function HeaderMain(){
    return(
        <header className="header-main">
            <nav>
                <li className="header-nav-li">Home</li>
                <li className="header-nav-li">About Me</li>
                <li className="header-nav-li">Education</li>
                <li className="header-nav-li">Skills</li>
                <li className="header-nav-li">Proyects</li>
                <li className="header-nav-li">Contact Me</li>
            </nav>
        </header>
    );
};



export default HeaderMain;
